description:
Naast de goa'uld vormen ook de replicators, intelligente zelfreplicerende machines, een bedreiging. De Asgard worden bijna door hen uitgeroeid.


5.Learning Curve - 23 Juli 1999 - SG-1 komt op een planeet waar kinderen worden gebruikt als kennisvergaarders

6.Point of View - 30 Juli 1999 - In een parallelle dimensie ontsnappen Carter en Kawalsky aan de Goa'uld met behulp van de Kwantumspiegel (quantum mirror).

7.Dead Man's Switch - 6 augustus 1999 - SG-1 wordt opgejaagd door een premiejager.

8.Demons - 13 augustus 1999 - SG-1 komt in een christelijke dorpje waar Sokar zich voordoet als Satan om gastheren te werven mbv een Unas.




